import { useNavigate } from 'react-router-dom';
import { useLocation } from 'react-router-dom';
import { Fragment, useState } from 'react'
import { Menu, Transition } from '@headlessui/react'
import { ChevronDownIcon } from '@heroicons/react/20/solid'
import Navbar from './Navbar';

function classNames(...classes) {
    return classes.filter(Boolean).join(' ')
}

export default function TicketSelect() {
    const location = useLocation();
    const movie = location.state?.movie;
    const selectedShowtime = location.state?.selectedShowtime;
    const navigate = useNavigate();
    const { selectedSeats } = location.state || {};

    const [selectedOption, setSelectedOption] = useState('Adult');

    return (
        <>
        <Navbar />
        <div className="flex items-center justify-center min-h-200 mt-6">
            <div className="w-full max-w-4xl p-8 space-y-8 bg-white shadow-lg rounded-xl">
                <div className="flex min-h-full flex-1 flex-col justify-center">
                    <h2 className="text-center text-2xl font-bold leading-9 tracking-tight text-gray-900">
                        Select Your Tickets for {movie.name}
                    </h2>
                    <p className="text-center text-m text-gray-700 mt-2">
                        {selectedShowtime.name}
                    </p>

                    <ul className="divide-y divide-gray-100 flex justify-center flex-col items-center mt-10">
                        {selectedSeats && selectedSeats.map((seatId, index) => (
                        <li 
                            key={index}
                            className="flex w-7/12 gap-x-6 py-10"
                        >
                            <div className="flex flex-row justify-between">
                                <span className="text-sm font-semibold leading-6 text-gray-900">
                                    {seatId}
                                </span>
                                <Menu as="div" className="relative inline-block text-left">
                                <div>
                                    <Menu.Button className="inline-flex w-full justify-center gap-x-1.5 rounded-md bg-white px-3 py-2 text-sm font-semibold text-indigo-600 shadow-sm ring-1 ring-inset ring-indigo-600 hover:bg-gray-50">
                                    {selectedOption} {/* Display the selected option here */}
                                    <ChevronDownIcon className="-mr-1 h-5 w-5 text-indigo-600" aria-hidden="true" />
                                    </Menu.Button>
                                </div>

                                <Transition
                                    as={Fragment}
                                    enter="transition ease-out duration-100"
                                    enterFrom="transform opacity-0 scale-95"
                                    enterTo="transform opacity-100 scale-100"
                                    leave="transition ease-in duration-75"
                                    leaveFrom="transform opacity-100 scale-100"
                                    leaveTo="transform opacity-0 scale-95"
                                >
                                    <Menu.Items className="absolute right-0 z-10 mt-2 w-56 origin-top-right rounded-md bg-white shadow-lg ring-1 ring-black ring-opacity-5 focus:outline-none">
                                    <div className="py-1">
                                        <Menu.Item>
                                        {({ active }) => (
                                            <button
                                            className={classNames(
                                                active ? 'bg-gray-100 text-gray-900' : 'text-gray-700',
                                                'block w-full px-4 py-2 text-left text-sm'
                                            )}
                                            onClick={() => setSelectedOption('All')}
                                            >
                                            Adult
                                            </button>
                                        )}
                                        </Menu.Item>
                                        <Menu.Item>
                                        {({ active }) => (
                                            <button
                                            className={classNames(
                                                active ? 'bg-gray-100 text-gray-900' : 'text-gray-700',
                                                'block w-full px-4 py-2 text-left text-sm'
                                            )}
                                            onClick={() => setSelectedOption('Current')}
                                            >
                                            Child
                                            </button>
                                        )}
                                        </Menu.Item>
                                        <Menu.Item>
                                        {({ active }) => (
                                            <button
                                            className={classNames(
                                                active ? 'bg-gray-100 text-gray-900' : 'text-gray-700',
                                                'block w-full px-4 py-2 text-left text-sm'
                                            )}
                                            onClick={() => setSelectedOption('Soon')}
                                            >
                                            Senior
                                            </button>
                                        )}
                                        </Menu.Item>
                                    </div>
                                    </Menu.Items>
                                </Transition>
                                </Menu>
                            </div>
                        </li>
                        ))}
                    </ul>

                    <div className="flex flex-row mt-16 space-x-4 justify-center">
                        <button 
                            onClick={() => navigate(-3)}
                            className="px-20 py-2 text-sm font-semibold text-indigo-600 border border-indigo-600 rounded-md hover:text-indigo-400 hover:border-indigo-400"
                        >
                        Cancel
                        </button>
                        <button 
                            className="px-20 py-2 text-sm font-semibold text-white bg-indigo-600 rounded-md hover:bg-indigo-500"
                            // onClick={() => handleNextClick(movie)}
                        >
                        Next
                        </button>
                    </div>
                </div>
            </div>
        </div>
        </>
    )
}
